import PropTypes from 'prop-types'

class Greeting extends React.Component {
  constructor(props) {
    super(props);
    this.state = {value: ''};
  }

  render(){
    return (
          <div className='Greeting'>
            <p>{this.props.text}</p>
          </div>

          );
  }
}

export default Greeting;
